import React, { useState } from 'react';
import styled from 'styled-components';
import { ControlPanelWrapper, Section, RangeControl, ResetButton } from '../../components/Controls';
import { ColorPicker } from '../../components/ColorPicker';

const TestContainer = styled.div`
  position: fixed;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  background: ${props => props.gradient};
  transition: background 0.3s ease;
`;

const ExitButton = styled.button`
  position: fixed;
  top: 20px;
  left: 20px;
  background: none;
  border: none;
  color: #333;
  cursor: pointer;
  padding: 8px;
  z-index: 1000;

  &:hover {
    color: #666;
  }

  svg {
    width: 24px;
    height: 24px;
  }
`;

const FullScreenButton = styled.button`
  position: fixed;
  top: 20px;
  right: 20px;
  background: none;
  border: none;
  color: #333;
  cursor: pointer;
  padding: 8px;
  z-index: 1000;

  &:hover {
    color: #666;
  }

  svg {
    width: 24px;
    height: 24px;
  }
`;

const ColorGradientTest = () => {
  const [isMinimized, setIsMinimized] = useState(false);
  const [isFullScreen, setIsFullScreen] = useState(false);
  const [selectedColor, setSelectedColor] = useState('#FF0000');
  const [steps, setSteps] = useState(32);

  const handleReset = () => {
    setSelectedColor('#FF0000');
    setSteps(32);
  };

  const generateGradient = () => {
    const r = parseInt(selectedColor.slice(1, 3), 16);
    const g = parseInt(selectedColor.slice(3, 5), 16);
    const b = parseInt(selectedColor.slice(5, 7), 16);
    return `linear-gradient(to right, 
      rgb(0, 0, 0), 
      rgb(${r}, ${g}, ${b}))`;
  };

  const toggleFullScreen = () => {
    if (!document.fullscreenElement) {
      document.documentElement.requestFullscreen();
      setIsFullScreen(true);
    } else {
      document.exitFullscreen();
      setIsFullScreen(false);
    }
  };

  return (
    <TestContainer gradient={generateGradient()}>
      <ExitButton onClick={() => window.history.back()}>
        <svg viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2">
          <path d="M15 19l-7-7 7-7" />
        </svg>
      </ExitButton>

      <FullScreenButton onClick={toggleFullScreen}>
        <svg viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2">
          {isFullScreen ? (
            <path d="M8 3v3a2 2 0 0 1-2 2H3m18 0h-3a2 2 0 0 1-2-2V3m0 18v-3a2 2 0 0 1 2-2h3M3 16h3a2 2 0 0 1 2 2v3" />
          ) : (
            <path d="M3 3h7v7H3zM14 3h7v7h-7zM14 14h7v7h-7zM3 14h7v7H3z" />
          )}
        </svg>
      </FullScreenButton>

      <ControlPanelWrapper
        title="Color Gradient Test"
        isMinimized={isMinimized}
        onMinimize={() => setIsMinimized(!isMinimized)}
      >
        <Section>
          <p>
            This test helps evaluate your display's color gradient rendering capabilities.
            Adjust the target color and number of steps to check for banding or color
            transition issues.
          </p>
        </Section>

        <Section>
          <ResetButton onClick={handleReset}>Reset Settings</ResetButton>
        </Section>

        <Section>
          <h3>Color Selection</h3>
          <ColorPicker
            color={selectedColor}
            onChange={setSelectedColor}
          />
        </Section>

        <Section>
          <h3>Gradient Steps</h3>
          <RangeControl>
            <label>
              <span>Steps: {steps}</span>
              <input
                type="range"
                min="8"
                max="256"
                value={steps}
                onChange={(e) => setSteps(Number(e.target.value))}
              />
            </label>
          </RangeControl>
        </Section>
      </ControlPanelWrapper>
    </TestContainer>
  );
};

export default ColorGradientTest;
